import Vue from 'vue'
import Vuetify from 'vuetify/lib'

Vue.use(Vuetify)

export default new Vuetify({
  theme: {
    themes: {
      light: {
        primary: '#1348f8',
        secondary: '#b0bec5',
        accent: '#FFE1F5',
        error: '#FF9292',
        dark: '#212121'
      }
    }
  }
})
